import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    root: {
        minHeight: '100vh',
        justifyContent: 'center',
        alignContent: 'center',
        paddingTop: theme.spacing(10),
    },
    welcome: {
        fontSize: 14,
        fontWeight: 800,
        color: theme.palette.common.main
    }
}));

export default useStyles;
